import java.util.HashSet;
public class ColourCode {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		HashSet<String> c=new HashSet<String>();
		c.add("Green");
		c.add("Red");
		c.add("Blue");
	    System.out.println(c.hashCode());
	    System.out.println(c);
	}

}
